import java.util.HashMap;
import java.util.Map;

public class TwoStringsSubstring {

    public static void main(String[] args) {
        // System.out.println(twoStrings("and", "art"));

        // System.out.println(twoStrings("be", "cat"));

        // System.out.println(twoStrings("hello", "world"));
        
        // System.out.println(twoStrings("hi", "world"));
        
        System.out.println(twoStrings("", 
            ""));
    
        System.out.println(twoStrings("", 
            ""));
            
        System.out.println(twoStrings("", 
        ""));

        System.out.println(twoStrings("", 
            ""));


    }

    public static String twoStrings(String s1, String s2){
        Map<String, Boolean> cache = new HashMap<>();
        return twoStringBoolean(s1,s2, cache)?"YES":"NO";
    }

    public static boolean twoStringBoolean(String s1, String s2, Map<String,Boolean> cache){
        boolean result = false;
        if (!cache.containsKey(s1)){
            result = s2.contains(s1);
            if (!result && s1.length()>1){
                result = (twoStringBoolean(s1.substring(0,s1.length()/2), s2, cache) || twoStringBoolean(s1.substring(s1.length()/2), s2, cache));
            }
            cache.put(s1, result);
        }else{
            result = cache.get(s1);
        }
        return result;
    }
}
